"""Decode base64 image from API response and save to file"""
import base64
import sys

# Paste the base64 string here (or pass as argument)
base64_string = """"""

# Decode and save
image_data = base64.b64decode(base64_string)
output_file = "decoded_image.png"

with open(output_file, "wb") as f:
    f.write(image_data)

print(f"Image saved to: {output_file}")
